import React, {useState, useEffect} from 'react'

function App() {

  const [data, setData] = useState([{}])
  const [showData, setShowData] = useState(false)


  useEffect(() => {
    fetch("/members").then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])

  const handleClick = () => {
    setShowData(true)
  }

  return (
    <div>
      <p>Get Chime details: </p><button onClick={handleClick}>Click me</button>
      {(typeof data.members === 'undefined') ? (
        <p>Loading...</p>
      ) : (
        data.members.map((member, i) => (
          <p key={i}>{member}</p>
        ))
      )}
    </div>
  )
}

export default App
